static inline void _normalize_digits(_cydecimal_ptr first, const bool mode){
    exponent_t i;
     if (mode) {
        i = _n_precision(first);
        if (i !=0){_left_shift_digits(first, i);};
        return;
    } else {
        i = _n_empty_zeros(first);
        if (i!=0){_right_shift_digits(first, i);};
        return;
    }
}

